This week the guys get out of jail after their 3 day stint. Now with absolutely nothing, they have to start all over again. As usual, D's got some real luck when Lil'Regg shows up in his uncle's RV. Finally making the team, Lil'Regg and the guys go out in search for a John and some hot bitches. And it starts all over again!
